import {useParams} from 'react-router-dom'
import { VALIDATOR_REQUIRE ,VALIDATOR_MINLENGTH} from '../../shared/components/utils/validators';
import Input from '../../shared/components/FormElements/Input';
import Button from '../../shared/components/FormElements/Button/Button';

const DUMMY_PLACES = [
  {
    id:'p1',
    title:'Empire State Building',
    description:'Tallent building in the world',
    imageUrl:'data:image/jpeg;base64,',
    location :{
        lat:40.748492,
        lng:-73.985699
    },
    address:' 20 W 34th St., New York, NY 10001, United States',
    creatorId:'u1'
},
{
    id:'p2',
    title:'Empire State Building 2',
    description:'Tallent building in the world',
    imageUrl:'data:image/jpeg;base64,',
    location :{
        lat:40.748492,
        lng:-73.985699
    },
    address:' 20 W 34th St., New York, NY 10001, United States',
    creatorId:'u2'
},
];

const UpdatePlace= () => {
  const placeId = useParams.placeId // it should be same as you mentioned in the dynamic route

  const identifiedPlace = DUMMY_PLACES.find(p => p.id  === placeId);
  console.log(identifiedPlace,placeId)
  if(!identifiedPlace){
    return(
      <div className="center">
        <h2>Could not find place!</h2>
      </div>
    )
  }

  return (
    <form>
      <Input
        id='title'
        element='input'
        type='text'
        label='Title'
        validators={[VALIDATOR_REQUIRE()]}
        errorText='Please enter a valid title.'
        onInput={() => {}}
        value={identifiedPlace.title}
        valid={true}
      />

      <Input
        id='description'
        element='textarea'
        type='text'
        label='Description'
        validators={[VALIDATOR_MINLENGTH(5)]}
        errorText='Please enter a valid description ( Please enter atleast 5 characters).'
        onInput={() => {}}
        value={identifiedPlace.description}
        valid={true}
      />
         <Button type='submit' disabled={true}>UPDATED PLACE</Button>
      
    </form>
  )
}

export default UpdatePlace

